import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import { motion, AnimatePresence } from 'framer-motion';
import './index.css';

// --- Components ---
import { Toaster } from './components/ui/Toaster';
// Create this new component to handle animations
import AnimatedPage from './components/common/AnimatedPage';

// --- Pages ---
import LandingPage from './pages/LandingPage';
import LoginPage from './pages/auth/LoginPage';
import RegisterPage from './pages/auth/RegisterPage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import DonationPage from './pages/DonationPage';
import ReviewsPage from './pages/ReviewsPage';
import SessionsPage from './pages/SessionsPage';
import AdminLoginPage from './pages/admin/AdminLoginPage';
import AdminDashboard from './pages/admin/AdminDashboard';
// Import your other pages when they are ready
// import UserDashboard from './pages/UserDashboard'; 
// import SessionDetailPage from './pages/SessionDetailPage';
// import ProfilePage from './pages/ProfilePage';

// A placeholder AuthContext for demonstration
// In a real app, this would provide the user object and roles
const useAuth = () => {
  // This is a mock. Replace with your actual context logic.
  return {
    isAuthenticated: !!localStorage.getItem('authToken'),
    isAdmin: localStorage.getItem('userRole') === 'ADMIN',
  };
};

function App() {
  const location = useLocation();

  return (
    <div className="App">
      {/* AnimatePresence needs a key to detect route changes */}
      <AnimatePresence mode="wait">
        <Routes location={location} key={location.pathname}>
          {/* Public Routes */}
          <Route path="/" element={<AnimatedPage><LandingPage /></AnimatedPage>} />
          <Route path="/login" element={<AnimatedPage><LoginPage /></AnimatedPage>} />
          <Route path="/register" element={<AnimatedPage><RegisterPage /></AnimatedPage>} />
          <Route path="/about" element={<AnimatedPage><AboutPage /></AnimatedPage>} />
          <Route path="/contact" element={<AnimatedPage><ContactPage /></AnimatedPage>} />
          <Route path="/donation" element={<AnimatedPage><DonationPage /></AnimatedPage>} />
          <Route path="/reviews" element={<AnimatedPage><ReviewsPage /></AnimatedPage>} />
          <Route path="/sessions" element={<AnimatedPage><SessionsPage /></AnimatedPage>} />

          {/* Admin Routes */}
          <Route path="/admin/login" element={<AnimatedPage><AdminLoginPage /></AnimatedPage>} />
          <Route
            path="/admin/dashboard"
            element={
              <AdminRoute>
                <AnimatedPage><AdminDashboard /></AnimatedPage>
              </AdminRoute>
            }
          />

          {/* Protected User Routes (Example) */}
          {/* <Route 
                        path="/dashboard" 
                        element={
                            <ProtectedRoute>
                                <AnimatedPage><UserDashboard /></AnimatedPage>
                            </ProtectedRoute>
                        } 
                    /> */}

          {/* Catch-all 404 Route */}
          <Route path="*" element={<AnimatedPage><NotFoundPage /></AnimatedPage>} />
        </Routes>
      </AnimatePresence>

      {/* Global toast notifications */}
      <Toaster />
    </div>
  );
}

// Wrapper for the main App component to provide Router context
const AppWrapper = () => (
  <Router>
    <App />
  </Router>
);

// Protected route component for authenticated users
const ProtectedRoute = ({ children }) => {
  const isAuthenticated = localStorage.getItem('authToken') // Simple auth check

  if (!isAuthenticated) {
    return <Navigate to="/login" replace />
  }

  return children
}

// Admin route component for admin users
const AdminRoute = ({ children }) => {
  const isAuthenticated = localStorage.getItem('authToken')
  const userRole = localStorage.getItem('userRole') // You'd get this from your auth context

  if (!isAuthenticated) {
    return <Navigate to="/login" replace />
  }

  if (userRole !== 'admin') {
    return <Navigate to="/dashboard" replace />
  }

  return children
};
// --- 404 Page Component ---
// It's better to make this its own component rather than defining it inline
const NotFoundPage = () => (
  <div className="min-h-screen bg-gradient-to-br from-gray-50 via-white to-primary-50 flex items-center justify-center">
      <div className="text-center">
          <motion.div
              initial={{ scale: 0 }}
              animate={{ scale: 1 }}
              transition={{ delay: 0.2, type: "spring", stiffness: 200 }}
              className="text-6xl text-violet-600 font-bold mb-4"
          >
              404
          </motion.div>
          <h1 className="text-2xl font-semibold text-gray-900 mb-4">Page Not Found</h1>
          <p className="text-gray-600 mb-8">The page you're looking for doesn't exist or has been moved.</p>
          <motion.a
              href="/"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="px-6 py-2 bg-violet-700 text-white font-semibold rounded-lg shadow-md hover:bg-violet-800 transition-colors"
          >
              Back to Home
          </motion.a>
      </div>
  </div>
);


export default AppWrapper;
